INSERT INTO `blast_content` VALUES ('1', '1', '1', '1508169600', '斗牛玩法 详细介绍', '<span style=\"font-size:16px;\">斗牛玩法 是本娱乐公司自主开发的新玩法 可玩性高 趣味多 希望各种彩民都能在这个玩法中找到自己的快乐！</span><br />\n<p>\n	<span style=\"font-size:16px;\">斗牛玩法是由5个位置（万千百十个）3个任意位置相加等于10的倍数&nbsp;</span><br />\n<span style=\"font-size:16px;\">斗牛玩法中的0代表数字10&nbsp;</span>\n</p>\n<p>\n	<span style=\"font-size:16px;\">有牛玩法 预设注数为：57895注 （牛牛不包括在其中）</span><br />\n<span style=\"font-size:16px;\">没牛玩法 预设注数为：35649注</span>\n</p>\n<p>\n	<span style=\"font-size:16px;\">牛1 到 牛9 &nbsp;会根据中间注数的变换而改变！</span><br />\n</p>\n<p>\n	<span style=\"font-size:16px;\"><strong>希望大家多多研究 斗牛中总会有你的 财缘</strong></span>\n</p>');
INSERT INTO `blast_content` VALUES ('2', '1', '1', '1508083200', '关于手机APP', '由于时间比较紧张手机APP 目前还处于开发阶段！<br />\n&nbsp;预计正式上线的时候 &nbsp;手机APP 会同时出来！');
INSERT INTO `blast_content` VALUES ('3', '1', '1', '1508083200', '测试大回馈', '<p style=\"font-size:13.3333px;text-align:center;\">\n	<span style=\"font-size:18px;line-height:1.5;\">财缘娱乐平台</span> \n</p>\n<p style=\"font-size:13.3333px;\">\n	<span style=\"font-size:12px;line-height:1.5;\"><span style=\"font-size:18px;\">财缘娱乐平台正在进行外测！凡是参与测试的玩家都可以领到开业后的红包奖励~</span><br />\n<span style=\"font-size:18px;\">活动规则</span></span> \n</p>\n<p style=\"font-size:13.3333px;\">\n	<span style=\"font-size:18px;line-height:1.5;\">时间：2017.10.16 &nbsp;至 &nbsp;2017.10.25</span> \n</p>\n<p style=\"font-size:13.3333px;\">\n	<span style=\"font-size:18px;line-height:1.5;\">注册账号 必须要绑定银行卡 &nbsp;可领取10万测试彩金</span> \n</p>\n<p style=\"font-size:13.3333px;\">\n	<span style=\"font-size:18px;line-height:1.5;\">开业后凭注册账号与银行卡号为凭证 根据投注总量计算现金红包！</span> \n</p>\n<p style=\"font-size:13.3333px;\">\n	<span style=\"font-size:18px;line-height:1.5;\"><br />\n</span> \n</p>\n<p style=\"font-size:13.3333px;\">\n	<span style=\"font-size:24px;line-height:1.5;\"> <strong>领取方式QQ：548855</strong></span> \n</p>\n<p style=\"font-size:13.3333px;\">\n	<span style=\"font-size:18px;line-height:1.5;\">财缘娱乐：王总</span> \n</p>\n<p style=\"font-size:13.3333px;\">\n	<span style=\"font-size:18px;line-height:1.5;\">2017.10.16</span> \n</p>');
